import React from 'react';
import TextField from '@material-ui/core/TextField';


const Input = (props) => {
  return (
    <TextField 
    id={props.id}
    label={props.label}
    required={props.required}
    style={props.style}
    name={props.name}
    type={props.name}
    onChange={props.handleInputChange}
    multiline={props.multiline}
    rows={props.rows}
  />
  )
}

export default Input
